import React from 'react';
import image from '../../assets/img.jpg';

class Image extends React.Component {
    

    render() {

        return (
            <section class="">
                <figure class='image__img'>
                    <img src= {image} />
                </figure>
                 <h1 class='template'>Seu pet em boas m√£os!</h1>
            </section>
        );
    }

}

export default Image;
